column8:
超発光！T10/T16互換　ハイパワーアルミヒートシンク1×8SMD　合計9LEDバルブ　ホワイト<br>
LED素子を使用したT10/T16ソケットに使用可能なLEDバルブです 。<br>
従来のものに比べ、LEDの寿命はとても長く、発光熱が低いため省エネ・エコ・長寿命と環境にも優しく今話題となっています。<br>

高輝度LEDを前面に1発、側面に8発装着した合計9発のLED360°照射！<br>
形状が合い次第、ポジション球・ナンバー灯・バックランプなどに最適です。<br>
LED特有のシャープ光、消費電力も少ないのでバックランプ、ポジションとしての役目には充分すぎるほど活躍します。<br>
HIDとの相性も抜群！<br>
<br>
<br>
【セット内容】<br>
2個セット<br>
【サイズ】<br>
約44mm×14mm <br>


<br>
<br>
◆注意事項◆<br>
◆必ずご利用規約をお読みください。<BR>
◆購入手続きを完了された時点で全て同意したものとみなします。<BR>
◆点灯チェックを行った上での貼り付けをお願い致します。<br>
◆LEDには極性(+,-)がございますので点灯しない場合は反対向きに差し込んで下さい。<br>
◆熱のこもる場所など、取付け場所によっては寿命が著しく短くなる場合がございます。十分にご注意ください。<br>
◆LEDには非常に繊細なチップ構造となります。お取り扱いには十分ご注意ください。ウィンカーへそのままお取り付けいただいた場合、ハイフラッシュとなります。<br>
◆一部のお車では球切れ警告灯が点灯する場合もございます。これは消費電力が減ったために発生する現象ですので、故障ではございませんが、ご注意ください。<br>
◆商品に関してのサポートは当店では出来かねますので専門業者にご相談下さい。<BR>
◆仕様は予告無く変更になる場合がございます。<br>
◆当商品は輸入品の為、多少の汚れ、スレがある場合がございます。<br>
◆初期不良による返送の際は必ず佐川急便にてお願い致します。佐川急便以外ですとお受取り致しかねますのでご注意下さい。<br>
◆商品到着後、すみやかに内容物のご確認及び点灯テストをお願いします。<br>
◆本品は純正部品ではありません。当商品をご利用いただいて生じた損害に対して当方は一切責任は負いかねます。<br>
◆あくまでも社外品となりますのでクオリティーを求める方はご遠慮ください。<br>
◆商品を加工されている場合又は色合い、明るさに関しましては主観判断ですので返品や返金には応じられません。<br>
◆ペーパーレスによる環境配慮・個人情報保護の為、ご注文確認メールをもって御利用明細とさせて頂いております。ご希望の方のみ、「明細書希望」とご要望欄にご記入ください。<br>
